INSERT INTO `crop_advisories` VALUES (1,1,'Low','Apply jeevamrut or cow dung slurry, use neem oil spray, and keep fields clean to discourage pests.'),(2,1,'Medium','Apply recommended fungicides or pesticides in moderate doses and manage irrigation carefully.'),(3,1,'High','Use strong chemical pesticides immediately and consult an agricultural expert.'),(4,2,'Low','Maintain proper water levels, introduce ducks/fish in fields, and spray neem-based formulations.'),(5,2,'Medium','Apply balanced fertilizer and targeted pesticide sprays for pest management.'),(6,2,'High','Use high-strength pesticides and seek expert advice for quick control.'),(7,3,'Low','Apply sand and ash in crop whorls, use neem extract, and intercrop with pulses to repel pests.'),(8,3,'Medium','Use recommended pesticide sprays and maintain proper nutrient balance.'),(9,3,'High','Use strong pesticides and intensive field monitoring for pest outbreaks.'),(10,4,'Low','Install pheromone traps, apply neem oil sprays, and use cow urine solution for early-stage pest control.'),(11,4,'Medium','Use appropriate pesticide sprays in moderate amounts and irrigate as per schedule.'),(12,4,'High','Apply systemic pesticides immediately and get expert consultation.'),(13,5,'Low','Practice trash mulching, apply neem cake in soil, and release Trichogramma egg parasitoids.'),(14,5,'Medium','Apply moderate pesticide doses and ensure irrigation at critical growth stages.'),(15,5,'High','Use chemical pesticides intensively and consult experts for pest/disease management.'),(16,6,'Low','Use neem seed kernel extract spray and farmyard manure to boost resistance.'),(17,6,'Medium','Apply fungicides or pesticides moderately and regulate irrigation.'),(18,6,'High','Use stronger pesticide applications and professional agricultural guidance.'),(19,7,'Low','Spray neem oil and intercrop with garlic or onion to naturally repel pests.'),(20,7,'Medium','Apply recommended pesticide doses and irrigate properly.'),(21,7,'High','Use strong pesticides immediately and consult experts.'),(22,8,'Low','Dust plants with ash, apply diluted cow urine spray, and use neem seed kernel extract.'),(23,8,'Medium','Apply pesticide sprays moderately and manage irrigation carefully.'),(24,8,'High','Apply strong pesticides and consult agricultural officers.'),(25,9,'Low','Handpick visible pests, spray neem seed kernel extract, and encourage natural predators like ladybird beetles.'),(26,9,'Medium','Apply pesticides moderately and ensure balanced fertilizer use.'),(27,9,'High','Use strong pesticides and consult experts immediately.'),(28,10,'Low','Dust wood ash on leaves, spray neem oil, and intercrop with marigold for pest prevention.'),(29,10,'Medium','Apply pesticide sprays in recommended doses for pest management.'),(30,10,'High','Use stronger chemical pesticides and consult experts quickly.'),(31,11,'Low','Spray diluted buttermilk/curd solution, use neem oil, and rotate crops with non-solanaceous varieties.'),(32,11,'Medium','Apply pesticide sprays moderately and maintain irrigation.'),(33,11,'High','Use chemical pesticides at high strength and seek expert guidance.'),(34,12,'Low','Dust fields with dry ash, apply garlic-chilli spray, and mix neem cake in soil.'),(35,12,'Medium','Apply recommended pesticide doses and maintain proper watering.'),(36,12,'High','Use systemic pesticides and consult agricultural experts.'),(37,13,'Low','Spray neem oil, apply cow dung slurry, and intercrop with coriander for pest resistance.'),(38,13,'Medium','Apply moderate pesticide sprays and ensure proper irrigation.'),(39,13,'High','Use strong chemical pesticides urgently and consult experts.'),(40,14,'Low','Dust ash on plants, use neem seed powder in soil, and allow sparrows to feed on pests.'),(41,14,'Medium','Apply recommended pesticide doses and regulate irrigation.'),(42,14,'High','Use high-strength pesticides and consult with agricultural officers.');
